import React from 'react';
import { Link } from 'react-router';


const Home = ({ post }) => {
    return (
        <div className="Home">
            <ul>
                {
                    post.map((post, index) => <li>
                        <div>
                            <h3>Post #{index} </h3>
                            <p>post.datetime</p>
                        </div>
                    </li>)
                }
            </ul>
        </div>
    );
};

export default Home;
